import React, { useState, useEffect } from 'react';
import axios from 'axios';




import Header from "../../components/Header/header"
import Footer from '../../components/Footer/footer';
import BoughtTicketBox from "../../components/BoughtTicketBox/boughtTicketBox"
import styles from './cart.module.css'



export default function Watch() {
    var [exh, setExh] = useState([])
    var [loading, setLoading] = useState(false)
    useEffect(() => {
        setLoading(true)
        axios
            .get('http://localhost:5713/watch')
            .then((response) => {
                setExh(response.data.exhs)
                setLoading(false)
                // console.log(typeof exh)
                // console.log(exh)
            })
            .catch((error) => {
                console.log(error);
            })
    }, [])

    const     props= {
        thumbnail:"fkdsla",
        name:"test1",
        location:"flsd",
        time:"flksfd",
        opentime:"toejfe"
    }
    return (
        <div className={styles.ticketbuy}>
            <Header />
            <div className={styles.tickets}>
                
            
            </div>
<BoughtTicketBox props={props}/>
<Footer/>
        </div>



    )
}
